import React from 'react'

export const HeroCard = ({
    id,
    superhero,
    alter_ego,
    first_appearance,
    characters
}) => {

    return (
        <div className="card mb-5 pe-1" style={ { maxWidth: 540 } }>
            <img className="card-img-top" src={`./assets/heroes/${id}.jpg`} />
            <div className="card-body">
                <h4 class="card-title"> {superhero} </h4>
                <h5 className="card-subtitle text-muted"> {alter_ego} </h5>
                <p className="card-text mt-4"> <b> First Appearance: </b> {first_appearance} </p>
                <p className="card-text"> Characters: {characters} </p>
            </div>
        </div>
    )
}
